import React from "react";
import QuestionBodyNoTime from "../singleplayer/question/QuestionBodyNoTime";
import Rewards from "../singleplayer/rewards/Rewards";
import Nav from "./Nav";
const Questions = () => {
  return (
    <div>
      <Nav />
      <Rewards />
      <QuestionBodyNoTime />
    </div>
  );
};

export default Questions;
